import React from "react";
import ReactDOM from "react";
import Header from "./components/Header";
import Image from "./components/Image";
import logo from "./img/im1.png";
// import Button2 from "./components/Button2";
import Button2 from "./App2";

class App extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      helpText: "Help text",
      textChange: "",
      name: prompt("Your name"),
    };
    this.inputClick = this.inputClick.bind(this);
  }
  componentDidUpdate(prevProp) {
    if (this.state.helpText !== "help") console.log("some");
  }
  render() {
    return (
      <div className="name">
        <Header aaaa="TEXT HEADER" />
        <div>
          <button onClick={Button2}>Full name</button>
          <p>Hello {this.props.name}</p>
        </div>
        <h1>{this.state.helpText}</h1>
        <h2>{this.state.textChange}</h2>
        <input
          placeholder={this.state.helpText}
          onChange={(event) =>
            this.setState({ textChange: event.target.value })
          }
          onClick={this.inputClick}
          onMouseEnter={this.mouseOver}
        />
        <p>{this.state.helpText === "Help text" ? "Yes" : "NO"}</p>
        <Image image={logo} />
      </div>
    );
  }
  inputClick() {
    this.setState({ helpText: "New header" });
    console.log("Clicked");
  }
  mouseOver() {
    console.log("Mouse Over");
  }
}

export default App;
